import React from 'react';
import Drawer from '@mui/material/Drawer';
import Button from '@mui/material/Button';
import Slider from '@mui/material/Slider';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Select from '@mui/material/Select';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import './LeftDrawer.css';

const LeftDrawer = () => {
  return (
    <Drawer
      variant='permanent'
      sx={{
        display: { xs: 'none', sm: 'block' },
        '& .MuiDrawer-paper': { boxSizing: 'border-box', width: '15rem' },
      }}
      open
    >
      <div className='container'>
        <h1>Slice Filters:</h1>
        <h2>Max Number of Features:</h2>
        <Slider
          aria-label='Number of Features'
          defaultValue={2}
          valueLabelDisplay='auto'
          step={1}
          marks
          min={1}
          max={5}
          size='small'
        />
        <h2>Minimum Sample Size:</h2>
        <Slider
          size='small'
          defaultValue={1000}
          aria-label='Small'
          valueLabelDisplay='auto'
          min={0}
          max={10000}
          step={100}
        />
        <h2>Fairness Metrics:</h2>
        <InputLabel id='demo-simple-select-helper-label'>Age</InputLabel>
        <Select
          labelId='demo-simple-select-helper-label'
          id='demo-simple-select-helper'
          value={age}
          label='Age'
          onChange={handleChange}
        >
          <MenuItem value=''>
            <em>None</em>
          </MenuItem>
          <MenuItem value={10}>Ten</MenuItem>
          <MenuItem value={20}>Twenty</MenuItem>
          <MenuItem value={30}>Thirty</MenuItem>
        </Select>
        {/* <FormGroup style={{ paddingLeft: '1rem' }}>
          <FormControlLabel control={<Checkbox />} label='Accuracy' />
          <FormControlLabel control={<Checkbox />} label='Precision' />
          <FormControlLabel control={<Checkbox />} label='Recall' />
          <FormControlLabel control={<Checkbox />} label='Specificity' />
          <FormControlLabel control={<Checkbox />} label='F1' />
          <FormControlLabel
            control={<Checkbox />}
            label='Negative Predictive Value'
          />
          <FormControlLabel
            control={<Checkbox />}
            label='False Negative Rate'
          />
          <FormControlLabel
            control={<Checkbox />}
            label='False Positive Rate'
          />
        </FormGroup> */}
        <Button variant='outlined' style={{ marginTop: '1rem' }}>
          Reset
        </Button>
      </div>
    </Drawer>
  );
};

export default LeftDrawer;
